                    <script type="text/javascript" src="/main.js"></script>
                </header>
                <body>
                    <form method="POST" action="/linking">
                        <div class="g-signin2" data-onsuccess="onSignIn"></div>
                    </form>
                </body>
            </html>
            )
    }
}


